import React from "react";
import "./style.css";

function Jumbotron() {
  return (
    <div className="jumbotron jumbotron-fluid text-center">
      <h1 className="display-4">(React) Google Books Search</h1>
      <p className="lead">
        Search for and Save Books of Internet
      </p>
    </div>
  );
}

export default Jumbotron;
